import React, { useState } from 'react';

function Draw({Obj}){
return(
    <div>
        {Obj.arr}.map((array1, index1) => (
        <div key={index1}>
          {array1.map((array2, index2) => (
            <div key={index2}>
              {array2.map((num, index3) => (
                <div key={index3}>{num}</div>
              ))}
            </div>
          ))}
        </div>
      ))}
    </div>
)
}

export default Draw;
